<div class="wrap">
  <h1>How To Use</h1>
  <p><h2>Just Insert Shortcode</h2><br/>
     [currentpost type="type"] or [currentpost type="type1,type2,..."] to show current post information. You cannot repeat same type in one shortcode. This plugin will add meta keywords, meta description, open graph and json-ld automatically if only URL of address bar same as permalink. Meta keywords based on exact word between title and description (for post improvement purpose). Thumbnail taken from featured image, then first image (img src), then image post attachment, if exists
     <br/>[currentpost type="type" label="label"] or [currentpost type="type1,type2,..." label="label1,label2,..."] to add label for current post information. For toc_neighbour_by_id and toc_neighbour_by_url, provide the id or url in the label. Use empty string to not show the label for spesific type, for example: ",this is second". For TOC, default label is "Contents".
     <br/>
     <br/>Available Type:
     <br/>== POST ==
     <br/>"ID" The ID of the post
     <br/>"post_author" The post author's user ID (numeric string)
     <br/>"post_author_link" a href of post author's name (author portofolio)
     <br/>"post_author_nick_link" a href of post author's nickname in square brackets, example: [nickname] (author portofolio)
     <br/>"post_date" Format: 0000-00-00 00:00:00
     <br/>"post_date_gmt" Format: 0000-00-00 00:00:00
     <br/>"post_content" The full content of the post
     <br/>"post_title" The title of the post
     <br/>"post_excerpt" User-defined post excerpt
     <br/>"post_status" Returns: Post status on success, false on failure
     <br/>"comment_status" Returns: { open, closed }
     <br/>"ping_status" Returns: { open, closed }
     <br/>"permalink" URL of the post
     <br/>"permalink_link": a href of permalink
     <br/>"address_bar_permalink": URL on the address bar
	 <br/>"address_bar_permalink_link": a href of URL on the address bar
     <br/>== BLOG ==
     <br/>"blog_name" Site title (set in Settings > General) where the post belong
     <br/>"blog_description" Site tagline (set in Settings > General) where the post belong
     <br/>"blog_wpurl" The WordPress address (URL) (set in Settings > General) where the post belong
     <br/>"blog_wpurl_link" a href of The WordPress address (URL) (set in Settings > General) where the post belong
     <br/>"blog_url" The Site address (URL) (set in Settings > General) where the post belong
     <br/>"blog_url_link" a href of The Site address (URL) (set in Settings > General) where the post belong
     <br/>"blog_charset" The "Encoding for pages and feeds" (set in Settings > Reading) where the post belong
     <br/>"blog_language" Language code for the current site where the post belong
     <br/>"blog_atom_url" The Atom feed URL (/feed/atom) of the site where the post belong
     <br/>"blog_atom_url_link" a href of The Atom feed URL (/feed/atom) of the site where the post belong
     <br/>"blog_rdf_url" The RDF/RSS 1.0 feed URL (/feed/rdf) of the site where the post belong
     <br/>"blog_rdf_url_link" a href of The RDF/RSS 1.0 feed URL (/feed/rdf) of the site where the post belong
     <br/>"blog_rss_url" The RSS 0.92 feed URL (/feed/rss) of the site where the post belong
     <br/>"blog_rss_url_link" a href of The RSS 0.92 feed URL (/feed/rss) of the site where the post belong
     <br/>"blog_rss2_url" The RSS 2.0 feed URL (/feed) of the site where the post belong
     <br/>"blog_rss2_url_link" a href of The RSS 2.0 feed URL (/feed) of the site where the post belong
     <br/>"blog_comments_atom_url" The comments Atom feed URL (/comments/feed)
     <br/>"blog_comments_atom_url_link" a href of The comments Atom feed URL (/comments/feed)
     <br/>"blog_comments_rss2_url" The comments RSS 2.0 feed URL (/comments/feed)
     <br/>"blog_comments_rss2_url_link" a href of The comments RSS 2.0 feed URL (/comments/feed)
     <br/>== AUTHOR ==
     <br/>"author_description" The post author's biographical info
     <br/>"author_display_name" The post author's display name publicly as
     <br/>"author_first_name" The post author's first name
     <br/>"author_last_name" The post author's last name
     <br/>"author_nickname" The post author's nick name
     <br/>== TIME ==
     <br/>"now" what time is it? Current time or snapshot time of cache/index
     <br/>== TOC ==
     <br/>use id="exclude_toc" on header to exclude it from TOC
     <br/>"toc": table of content from all heading (optional: link to anchor), with link to TOC in the bottom of the page
     <br/>"toc_without_back": table of content from all heading (optional: link to anchor)
     <br/>"toc_neighbour_by_id": table of content from all heading in other post in the same web, by id (optional: link to anchor)
     <br/>"toc_neighbour_by_url": table of content from all heading in other post in the same web, by url (optional: link to anchor)
     <br/>== VARIABLE ==
     <br/>notes: 
     <br/>1. variable name regex: a-zA-Z_, ex: this_isVARiable
     <br/>2. output: [1] function call (unescape dot), ex: Math.round(); [2] operator, ex: x+y; x+' '+y; [3] simple if then else ?:, ex: x==y?(x==z?x:z):y; [4] string (maybe need escape with \), ex: "abc"; 'abc'; [5] assignment: use variable input with formula, ex: [currentpost type="variableinput" label="x|||formula:y+z"] [6] no loop, no error handling
     <br/>3. character replacement: > replace with &gt;, < replace with &lt;, . replace with \. (dot with \ escape)
     <br/>"variableinput": create textbox as an input of variable, 
     <br/>- input with initial value, label: "variable_name|||initial value"
     <br/>- input as assignment, label: "variable_name|||formula:theformula"
     <br/>"variableoutput": create a span to display variable's value, 
     <br/>- output without enclose, label: "variable_name" 
     <br/>- output with enclose, label: "variable_name|||enclose", ex: "x|||'" result: 'abc', "y|||[" result: [xyz]
     <br/>== Data Tables ==
     <br/>"spreadsheet_to_html": display tools to convert spreadsheet to HTML code and add an spreadsheet_to_html shortcode
     <br/>"datatable": convert usual table to jquery datatables
     <br/>
     <br/>Usage Example: 
     <br/>[current_post type="permalink, post_date"]
     <br/>Result Example:
     <br/><img src="data:image/png;base64," />
     <br/>
     <br/>Usage Example: 
     <br/>[current_post type="post_author_nick_link"]
     <br/>Result Example:
     <br/><a href="https://example.org/author/basit/">[bst]</a>
     <br/>
     <br/>Usage Example: 
     <br/>[current_post type="post_author_nick_link" label="This is the sample of post_author_nick_link"]
     <br/>Result Example:
     <br/>This is the sample of post_author_nick_link <a href="https://example.org/author/basit/">[bst]</a>
     <br/>
     <br/>Usage Example:
     <br/>[current_post type="toc_neighbour_by_id" label="1"]
     <br/>Result Example:
     <br/><ul><li><a href="https://example.org/#head1">This is Heading</a></li>
              <li><a href="https://example.org/#head2">This is another Heading</a></li>
              <li><a href="https://example.org/2/#head3">This is Heading in page 2</a></li>
              <li><a href="https://example.org/3/#head4">This is Heading in page 3</a></li>
              <li><a href="https://example.org/3/#head5">This is another Heading in page 3</a></li>
           </ul>
     <br/>
     <br/>Usage Example:
     <br/>[current_post type="spreadsheet_to_html"]
     <br/>Result Example:
     <br/>
     <?php 
      include_once plugin_dir_path(__FILE__) . 'includes/current-post-functions.php';
      echo spreadsheetToHTML();
     ?>
     <br/>
     <br/>Usage Example:
     <br/>More example click <a href="https://pdsi.unisayogya.ac.id/how-to-write-a-customizable-post/" target="blank_">here</a>
     <br/>Input text here [current_post type="variableinput" label="x|||this is x"]
     <br/>Result [current_post type="variableoutput" label="x"]
     <br/>Result Example:
     <br/><p>Input text here <input type="text" autocomplete="off" id="ix" onkeyup="fillx()" value="this is x "><script>function fillx(){spanobj=document.getElementsByClassName('ox');for(var i=0,max=spanobj.length;i<max;i++){while(spanobj[i].firstChild){spanobj[i].removeChild(spanobj[i].firstChild);}spanobj[i].appendChild(document.createTextNode(document.getElementById('ix').value));}}</script> </p>
     <br/><p>Result <span class="ox ">tes </span><script>fillx ()</script> </p>
     <br/><h2>Extras</h2>
     <br/>Hijri date format (Bahasa Indonesia Only). Setting > General > Date Format: Y-m-d-4 for long format, Y-m-d-5 for short format
  </p>
</div>